// SignIn.jsx
import React from 'react';
import { Link } from 'react-router-dom';  
import Container from "../../components/layout/Container";
import Text from "../../components/text/size";
import BasicInput from "../../components/input/BasicInput";
import PasswordInput from "../../components/input/PasswordInput";
import CheckboxWithLabel from "../../components/checkbox/CheckboxWithLabel";
import S from "./style";
import BasicButton from '../../components/button/BasicButton';


const helperLinks = [
    { label: "아이디 찾기", to: "/find-id" },
    { label: "비밀번호 찾기", to: "/find-password" },
];

const SignIn = () => (
    <Container>
        <S.LoginWrapper>
            <Text.H3>로그인</Text.H3>
            <S.InputWrapper>
                <BasicInput type="text" placeholder="아이디를 입력하세요" />
                <PasswordInput placeholder="비밀번호를 입력하세요" />
            </S.InputWrapper>

            <S.Options>
                <CheckboxWithLabel label="아이디 기억하기" />

                <S.LinkGroup>
                    {helperLinks.map(({ label, to }) =>
                        label === "비밀번호 찾기" ? (
                            <S.PasswordText key={to}>
                                <Text.Body3
                                    as={Link}
                                    to={to}
                                    mr="16px"
                                >
                                    {label}
                                </Text.Body3>
                            </S.PasswordText>
                        ) : (
                            <Text.Body3
                                as={Link}
                                key={to}
                                to={to}
                                mr="16px"
                            >
                                {label}
                            </Text.Body3>
                        )
                    )}
                </S.LinkGroup>
            </S.Options>

            <BasicButton basicButton="large" variant="gray">로그인</BasicButton>
            <BasicButton basicButton="large" variant="gray">회원가입</BasicButton>
        </S.LoginWrapper>
    </Container>
);

export default SignIn;
